INSERT INTO `product_information` VALUES (1797,'Inkjet C/8/HQ','Inkjet printer, color, 8 pages per minute, high resolution (photo quality). Memory: 16MB. Dimensions (HxWxD): 7.3 x 17.5 x 14 inch. Paper size: A4, US Letter, envelopes. Interface: Centronics parallel, IEEE 1284 compliant.',12,3,'+02-00',102094,'orderable',349,288,'http://www.supp-102094.com/cat/hw/p1797.html'),(2459,'LaserPro 1200/8/BW','Professional black and white laserprinter, resolution 1200 dpi, 8 pages per second. Dimensions (HxWxD): 22.37 x 19.86 x 21.92 inch. Software: Enhanced driver support for SPNIX v4.0; MS-DOS Built-in printer drivers: ZoomSmart scaling technology, billboard, handout, mirror, watermark, print preview, quick sets, emulate laserprinter margins.',12,5,'+03-00',102099,'under development',699,568,'http://www.supp-102099.com/cat/hw/p2459.html'),(3127,'LaserPro 600/6/BW','Standard black and white laserprinter, resolution 600 dpi, 6 pages per second. Interface: Centronics parallel, IEEE 1284 compliant. Memory: 8MB 96KB receiver buffer. MS-DOS ToolBox utilities for SPNIX AutoCAM v.17 compatible driver.',12,4,'+03-00',102087,'orderable',498,444,'http://www.supp-102087.com/cat/hw/p3127.html'),(2254,'HD 10GB /I','10GB capacity hard disk drive (internal). These drives are intended for use in today\'s demanding, data-critical enterprise environments and are ideal for use in RAID applications. Universal option kits are configured and pre-mounted in the appropriate hot plug tray for immediate installation into your corporate server or storage system.',13,2,'+02-00',102071,'obsolete',453,371,'http://www.supp-102071.com/cat/hw/p2254.html'),(3353,'HD 10GB /R','10GB Removable hard disk drive for 10GB Removable HD drive. Supra7 disk drives provide the latest technology to improve enterprise performance, increasing the maximum data transfer rate up to 160MB/s.',13,1,'+03-00',102071,'obsolete',489,413,'http://www.supp-102071.com/cat/hw/p3353.html'),(3069,'HD 10GB /S','10GB hard disk drive for Standard Mount. Backward compatible with Supra5 systems, users are free to deploy and re-deploy these drives to quickly deliver increased storage capacity. Supra drives eliminate the risk of firmware incompatibility.',13,1,'+02-00',102051,'obsolete',436,350,'http://www.supp-102051.com/cat/hw/p3069.html'),(2253,'HD 10GB @5400 /SE','10GB capacity hard disk drive (external) SCSI interface, 5400 RPM. Universal option kits are configured and pre-mounted in the appropriate hot plug tray for immediate installation into your corporate server or storage system. Supra drives eliminate the risk of firmware incompatibility.',13,2,'+03-00',102069,'obsolete',399,322,'http://www.supp-102069.com/cat/hw/p2253.html'),(3354,'HD 12GB /I','12GB capacity harddisk drive (internal). Supra drives eliminate the risk of firmware incompatibility. Backward compatibility: You can mix or match Supra2 and Supra3 devices for optimized solutions and future growth.',13,2,'+02-00',102066,'orderable',543,478,'http://www.supp-102066.com/cat/hw/p3354.html'),(3072,'HD 12GB /N','12GB hard disk drive for Narrow Mount. Supra9 hot pluggable hard disk drives provide the ability to install or remove drives on-line. Our hot pluggable hard disk drives are required to meet our rigorous standards for reliability and performance.',13,1,'+03-00',102061,'orderable',567,507,'http://www.supp-102061.com/cat/hw/p3072.html'),(3334,'HD 12GB /R','12GB Removable hard disk drive. With compatibility across many enterprise platforms, you are free to deploy and re-deploy this drive to quickly deliver increased storage capacity. Supra7 Universal disk drives are the second generation of high performance hot plug drives sharing compatibility across corporate servers and external storage enclosures.',13,2,'+03-00',102090,'orderable',612,512,'http://www.supp-102090.com/cat/hw/p3334.html'),(3071,'HD 12GB /S','12GB hard disk drive for Standard Mount. Supra9 hot pluggable hard disk drives provide the ability to install or remove drives on-